function Pagesix() {
  return (
    <div>
      <p style={{ color: "rgba(255, 93, 34, 1)", fontWeight: "700" }}>
     Price Plan
      </p>
      <h3 style={{ fontWeight: "700" }}>Our Case Studies</h3>
    </div>
  );
}

export default Pagesix;
